  const [cvv, setCVV] = useState("");
  const [name, setName] = useState("");
  const [paymentSuccess, setPaymentSuccess] = useState(false);
  const [address, setAddress] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    loadAddress();
  }, []);

